import { Text, View, StyleSheet } from 'react-native';

export default class App extends Component {
  render() {
    return (
      <View>
        <View style={styles.fundo}>
          <Text style={styles.header}>FENDER YNGWIE MALMSTEEN STRATOCASTER</Text>
        </View>

        <Image
            source={{
              uri:
                'https://timeline.canaltech.com.br/327901.1400/por-que-harry-potter-e-o-enigma-do-principe-e-a-pior-adaptacao-de-toda-a-saga.jpg',
            }}
            style={styles.image}
          />

        <View>
          <Text style={styles.titulo}>SEGUNDO TÍTULO</Text>
